				bone='RightFoot',
				lpos=vector3(0,-0.07,0)*111,
			}, 
			{
				"rightToe", 
				bone='RightToe',
				lpos=vector3(0,0,0),
			}, 		
		}
	}
	conInfo={}
	local config=constraintMarkingConfig
	for i,v in ipairs(config.markers) do
		conInfo[i]={ v[1], con=con, markerPos=markerPos}
	end
	fc.markConstraints(constraintMarkingConfig,conInfo, nil, mot, nil, {drawSignals=false, drawCon=false})

	return {[conInfo[1][1]]=conInfo[1].con, [conInfo[2][1]]=conInfo[2].con, [conInfo[3][1]]=conInfo[3].con, [conInfo[4][1]]=conInfo[4].con}
end

return { toMujoco=Mujoco, toHanyang=Hanyang, markConstraints=markLafanConstraints}
